column8:
　クールマックスエブリデイファブリックを採用。 吸水速乾、クーリングに優れた特性を持つ快適ソックス。 <BR>
<BR>
ハイクッション底パイル<BR>
クッション性に優れ、足への負担を軽減します。<BR>
<BR>
機能性素材を採用<BR>
吸湿速乾、クーリングに優れた機能性素材を採用。ドライ感をキープするだけでなく、抗菌防臭加工や、優れたフィット感で快適なプレーをサポートします。<BR>

<BR>
プライス：オープン <BR>
サイズ：Men'sフリー（25～27cm） <BR>
素材：ポリエステル、綿、ナイロン（クールマックスファブリック）<BR>
原産国：中国<BR>

<br><br><br>
<FONT color="#B40404">【ゆうメール対応商品です】</FONT><BR>
・1封筒に6枚まで入れることができます。<br>
・必ず<FONT color="#B40404">ゆうメール</FONT>を選択して下さい。<br>
・ご注文後の配送方法変更は出来ません。<BR>
・必ずお買い物ガイドをご参照下さい。<BR><div class="img-block">
 <img src="" alt="" />  
</div>
