　機能性天然素材メリノウール <BR>
温度調節機能とモイスチャーコントロール性を発揮し、冬は暖かく、夏は汗ムレを防止。常にシューズ内を快適に保ちます。<BR>
<BR>
左右非対称設計を採用<BR>
自然なフィット感とサポート性が得られ、長時間の着用でも快適さを保ち、疲労を軽減します。<BR>
<BR>
衝撃吸収パッドを装着<BR>
圧が加わりやすい拇指球部分とカカト部分には衝撃吸収素材を装着しています。<BR>
<BR>
2層構造クッション<BR>
特に負担のかかりやすいカカト部分には、耐久性に優れた２層構造のクッション材を採用しています。<BR>
<BR>
コンフォートシーム製法<BR>
縫い目が肌に当たりにくい特殊な縫製を採用。快適な着用感を提供します。<BR>
<BR>
高通気性メッシュ<BR>
通気性・速乾性に優れたメッシュ素材が汗を素早く蒸散させ、ドライな着用感を保ちます。<BR>
<BR>
<BR>

素材：メリノウール、ナイロン、ポリウレタン<BR>
サイズ：フリー（25-27cm）<BR>
対象：メンズ<BR>
製造国：日本<BR>



<br><br><br>
<FONT color="#B40404">【ゆうメール対応商品です】</FONT><BR>
